<div class="entities" style="line-height: 2.5; direction: ltr">A conserved mechanism for gating in an ionotropic glutamate receptor . Ionotropic glutamate receptor ( iGluR ) channels control synaptic activity . The crystallographic structure of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42262
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , the prototypical iGluR , reveals a clamshell-like ligand-binding domain ( LBD ) that closes in the presence of glutamate to open a gate on the pore lining α-helix . How LBD closure leads to gate opening remains unclear . Here , we show that bending the pore helix at a highly conserved alanine residue ( Ala - 621 ) below the gate is responsible for channel opening . Substituting Ala - 621 with the smaller more flexible glycine resulted in a basally active , nondesensitizing channel with ∼ 39 - fold increase in glutamate potency without affecting surface expression or binding . On 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42262
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( A621G ) , the partial agonist kainate showed efficacy similar to a full agonist , and competitive antagonists CNQX and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB03759
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 acted as a partial agonists . DB00134 - 629 in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42262
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 sits above the gate and is critical in transmitting LBD closure to the gate . Substituting DB00134 - 629 with the flexible glycine resulted in reduced channel activity and glutamate potency . The pore regions in potassium channels are structurally similar to iGluRs . Whereas potassium channels typically use glycines as a hinge for gating , iGluRs use the less flexible alanine as a hinge at a similar position to maintain low basal activity allowing for ligand-mediated gating .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Immunohistochemical localization of adherens junction components in blood-brain barrier microvessels of the rat . The morphology and molecular composition of intercellular adherens junctions have most frequently been described in epithelial cells and the fascia adhaerens of the intercalated disc . A group of cytoplasmic molecules is known to be associated with adherens junctions . The intercellular bond is mediated by cadherins which bridge the cells by homophilic binding . Recently , endothelial cells have also been shown to form intercellular junctions of the adherens-type . However , they are morphologically less distinct and little is known about their molecular components . In this study we report the localization of some adherens junction components in intact microvessels of the blood-brain barrier in the rat . We used antibodies raised against alpha-actinin , vinculin , zyxin , cadherin ( antipan-cadherin antibody ) and A - P62158 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P19022
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) in immunohistochemical experiments at light and electron microscopical levels . Microvessel walls reacted positively for all antigens throughout postnatal development . All antigens were localised , though not necessarily exclusively , to interendothelial junctions . At the ultrastructural level , pan-cadherin reactivity was present throughout the entire length of the cleft . These results could mean that in blood-brain barrier endothelial cells the complex tight junction is embedded in an adherens junction which occupies the entire length of the cleft .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Acute kidney injury and inflammatory immune reconstitution syndrome in mixed genotype ( A / E ) hepatitis B virus co-infection in HIV-associated lymphoma . We report a first case of HIV-associated lymphoma (

</mark>
 ) presenting with acute kidney injury ( AKI ) and inflammatory immune reconstitution syndrome ( IRIS ) . A 39 - year-old male , treated with nonsteroidal anti-inflammatory drugs ( NSAIDs ) for one month prior to admission , developed AKI , left testicular tumor , and recurrent swelling of the right parotid gland . A resected testicular tumor exhibited features intermediate between diffuse large B-cell lymphoma and Burkitt lymphoma . Renal biopsy showed hydro-degeneration of renal tubules , interstitial inflammatory cells , and a small number of lymphoma cells in the sub-capsule , compatible with acute interstitial nephritis .

 renal dysfunction rapidly recovered following chemotherapy and combination antiretroviral therapy ( cART ) . He developed pneumonia concomitantly with a decrease in HIV-RNA level and an increase in

<div class="entities" style="line-height: 2.5; direction: ltr">Neurological impairment in experimental antiphospholipid syndrome is associated with increased ligand binding to hippocampal and cortical serotonergic

 - immunohistochemistry was performed , to check for activation of astrocytes , microglia and macrophages . Ligand binding densities of DB01221 , AMPA , GABAA and

<div class="entities" style="line-height: 2.5; direction: ltr">Molecular basis for the immunostimulatory activity of guanine nucleoside analogs : activation of Q9NYK1 . Certain Q99618 - substituted and N7 , Q99618 - disubstituted guanine ribonucleosides comprise a class of small molecules with immunostimulatory activity . In a variety of animal models , these agents stimulate both humoral and cellular immune responses . The antiviral actions of these guanosine analogs have been attributed to their ability to induce type I IFNs . However , the molecular mechanisms by which the guanosine analogs potentiate immune responses are not known . Here , we report that several guanosine analogs activate Q9NYK1 ( Q9NYK1 ) . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , 7 - deazaguanosine , and related guanosine analogs activated mouse immune cells in a manner analogous to known TLR ligands , inducing cytokine production in mouse splenocytes ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and IL - 12 , type I and II IFNs ) , bone marrow-derived macrophages ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05231
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and IL - 12 ) , and in human peripheral blood leukocytes ( type I IFNs , tumor necrosis factor alpha and IL - 12 ) . The guanosine congeners also up-regulated costimulatory molecules and MHC I / II in dendritic cells . Genetic complementation studies in human embryonic kidney 293 cells confirmed that the guanosine analogs activate cells exclusively via Q9NYK1 . The stimulation of Q9NYK1 by the guanosine analogs in human cells appears to require endosomal maturation because inhibition of this process with chloroquine significantly reduced the downstream activation of NF-kappaB . However , Q9NR97 activation by R - 848 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 activation by [ S - [ 2,3- bis ( palmitoyloxy ) - ( 2 - RS ) - propyl ] - N-palmitoyl-R - DB00151 - S - DB00133 - Lys 4 - OH , trihydrochloride ) ] were not inhibited by chloroquine , whereas Q9NR96 activation by CpG oligodeoxynucleotides was abolished . In summary , we present evidence that guanosine analogs activate immune cells via Q9NYK1 by a pathway that requires endosomal maturation . Thus , the B cell-stimulating and antiviral activities of the guanosine analogs may be explained by their Q9NYK1 - activating capacity .</div>
